import React from "react";
import Link from "next/link";

export const Users = (props) => {
  let users = "";
  console.log(props, "de users");

  return (
    <ul>
      {props.users.map(
        (user) => (
          (<li key={0}>{user.name}</li>), (<li key={1}>{user.website}</li>)
        )
      )}
    </ul>
  );
};

export default Users;
